import Container from "../component/Container";

function Dashboard() {
  return (
    <div className="w-screen h-screen grid grid-cols-6 grid-rows-6">
      <Container></Container>
      <Container className={'col'}></Container>
      <Container></Container>
    </div>
  );
}

export default Dashboard;
